oNormal">Le techtalk a pour objectif de \r\n vous familiariser avec ces notions en vue de les appliquer à vos \r\n backlogs.<o:p></o:p></p><p class="MsoNormal">Pour la mise en œuvre \r\n effective dans vos backlogs\\, un accompagnement personnalisé suivra. Il \r\n se fera lors du suivi des équipes (mission 1 présentée lors de la RIM) \r\n mais aussi via des interventions ponctuelles à la demande.<o:p></o:\r\n p></p><div><p class="MsoNormal"><span style="color:\r\n #5F5F5F">_________________________________________________________________\r\n _______________</span> <o:p></o:p></p></div><div><div style="margin-top:\r\n 18.0pt\\;margin-bottom:15.0pt"><p class="MsoNormal"><span style="font-size:\r\n 18.0pt\\;font-family:&quot\\;Segoe UI&quot\\;\\,sans-serif\\;color:\r\n #252424">Réunion Microsoft Teams</span><span style="font-family:&quot\\;\r\n Segoe UI&quot\\;\\,sans-serif\\;color:#252424"> <o:p></o:\r\n p></span></p></div><div style="margin-bottom:15.0pt"><div><p \r\n class="MsoNormal"><b><span style="font-size:10.5pt\\;font-family:&quot\\;\r\n Segoe UI&quot\\;\\,sans-serif\\;color:#252424">Rejoindre sur votre \r\n ordinateur ou application mobile</span></b><b><span style="font-family:\r\n &quot\\;Segoe UI&quot\\;\\,sans-serif\\;color:#252424"> <o:p></o:\r\n p></span></b></p></div><p class="MsoNormal"><span style="font-family:\r\n &quot\\;Segoe UI&quot\\;\\,sans-serif\\;color:#252424"><a href="https:\r\n //teams.microsoft.com/l/meetup-join/19%3ameeting_YWYxNTZlM2UtYzE1Yi00YWZhL\r\n WJmNmUtZWQ0MjMxMjNiNGQ0%40thread.v2/0?context=%7b%22Tid%22%3a%22039c67fe-4\r\n 9fc-42f3-a2a4-0a85eee29a7d%22%2c%22Oid%22%3a%226007a1bd-8e75-47dc-a781-e4d\r\n 6d5500859%22%7d" target="_blank"><span style="font-size:10.5pt\\;\r\n font-family:&quot\\;Segoe UI Semibold&quot\\;\\,sans-serif\\;color:\r\n #6264A7">Cliquez ici pour participer à la réunion</span></a> <o:p></o:\r\n p></span></p></div><div style="margin-bottom:3.0pt"><div><p \r\n class="MsoNormal"><span style="font-size:10.5pt\\;font